import React, { useEffect } from "react";
import { useNavigate } from 'react-router-dom';

function WrongPage() {

  const navigate = useNavigate();
  useEffect(() => {
    setTimeout(() => {
      navigate('/')
    }, 2000)
  })

  return (
    <>
      <h1>There is nothing to see here!</h1>
      <h2>Guess You really are bored?</h2>
    </>
  )
};

export default WrongPage;
